import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Auth from './components/Auth';
import Events from './components/Events';
import Header from './components/Shared/Header';
import Footer from './components/Shared/Footer';

const App = () => {
    return (
        <Router>
            <Header />
            <Switch>
                <Route path="/" exact component={Events.EventList} />
                <Route path="/event/:id" component={Events.EventDetails} />
                <Route path="/login" component={Auth.Login} />
                <Route path="/register" component={Auth.Register} />
                <Route path="/create-event" component={Events.EventForm} />
                <Route path="/participants" component={Participants.ParticipantList} />
            </Switch>
            <Footer />
        </Router>
    );
};

export default App;
